import logo from './img/logo.png';
import './App.css';


function App() {
  return (
    <div className="parent">
      <div className="entry">
        <div className="bar">
          <div className="logodiv">
            <img className="logo" src={logo}/>
            <div>LinkedIn</div>
            <div>Github</div>
            <div></div>
          </div>
          <div>hello</div>
        </div>
      </div>
    </div>
  );
}

export default App;
